import builder from '../util/https-base'

const { https } = builder("/cliente")

const getAll = () => {
    return https.get("/all")
}

const getByUUID = (uuid) => {
    return https.get("/uuid",JSON.stringify({
        "UUID": "0c77c59b-1951-4a74-8175-0c27fd01727b"}))
}

export default {
    getAll,
    getByUUID
}
